// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "./RoleManager.sol";

contract MainSupplyChain {

  RoleManager roleManager;

  constructor(address _roleManagerAddr) {
    // contract address role manager => data ini dari scripts/deploy.js perhatikan line 11
    roleManager = RoleManager(_roleManagerAddr);
  }

  modifier onlyFactory() { 
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.Pabrik), "Access restricted to Factory role");
    _;
  }

  modifier onlyBPOM() {
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.BPOM), "Access restricted to BPOM role");
    _;
  }
 
  modifier onlyPBF() {
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.PBF), "Access restricted to PBF role");
    _; 
  }

  enum en_roles { Pabrik, PBF, BPOM, Retailer }
  enum en_statusCert { Requested, Approved }
  enum en_jenisSediaan { Tablet, Kapsul, KapsulLunak, SerbukOral, CairanOral, CairanObatDalam, CairanObatLuar, FilmStrip, Pil}
  enum en_tipePermohonan { ObatLain, CCP }

  struct st_userData {
    string name;
    string instanceName;
    address userAddr; 
  }

  struct st_cpotbData {
    string cpotbId;
    string senderName;
    address factoryAddr;
    string factoryName;
    en_jenisSediaan jenisSediaan;
    en_statusCert status;
    uint timestampRequest;
    uint timestampApprove;
    string cpotbNumber;
    address bpomAddr;
    string receiverName;
  }

  struct st_cdobData {
    string cdobId;
    string senderName;
    address pbfAddr; 
    string pbfName; 
    en_tipePermohonan tipePermohonan;
    en_statusCert status;
    uint timestampRequest;
    uint timestampApprove; 
    string cdobNumber;
    address bpomAddr;
    string receiverName;
  }

  mapping (address => st_userData) private userData; 
  mapping (string => st_cpotbData) public cpotbDataById;
  mapping (string => st_cdobData) cdobDataById;
  mapping (string => en_jenisSediaan) public cpotbJenisSediaan;
  
  st_cpotbData[] public allCpotbData;
  st_cdobData[] public allCdobData;

  event evt_UserRegistered(address userAddr, string name, string instanceName, uint8 role);
  event evt_cpotbRequested(string senderName, address factoryAddr, string factoryName, en_jenisSediaan jenisSediaan, string cpotbId, uint timestampRequest);
  event evt_cpotbApproved(address bpomAddr, string receiverName, string factoryName, string cpotbNumber, uint timestampApprove);
  event evt_cdobRequested(string senderName, address pbfAddr, string pbfName, en_tipePermohonan tipePermohonan, string cdobId, uint timestampRequest);
  event evt_cdobApptoved(address bpomAddr, string receiverName, string pbfName, string cdobNumber, uint timestampApprove);


  function registerUser(
    string memory _name, 
    string memory _instanceName,
    address _userAddr,
    uint8 _userRole
  ) public {
    userData[_userAddr] = st_userData({
      name: _name,
      instanceName: _instanceName,
      userAddr: _userAddr
    });

    RoleManager.en_roles role = RoleManager.en_roles(uint8(_userRole));
    roleManager.assignRole(_userAddr, role);

    if(_userRole == uint8(en_roles.Pabrik)) {
      requestCpotb('PT. Budi Pekerti', 'aauhd8j', 'TAKAKI YUYA', 0); 
    }

    emit evt_UserRegistered(_userAddr, _name, _instanceName, uint8(role)); 
  }

  function getRegisteredUser(address _userAddr) public view returns (address, string memory, string memory, uint8) {
      require(roleManager.checkRegistration(_userAddr), "User is not registered"); 

      st_userData memory user = userData[_userAddr];
      RoleManager.en_roles role = roleManager.getRole(_userAddr);
       
      return (user.userAddr, user.name, user.instanceName, uint8(role)); 
  }

  function requestCpotb(
      string memory _instanceName,
      string memory _cpotbId,
      string memory _senderName,
      uint8 _jenisSediaan
  ) public onlyFactory {
      st_cpotbData memory newCpotbData = st_cpotbData({
          cpotbId: _cpotbId,
          senderName: _senderName,
          factoryAddr: msg.sender, 
          factoryName: _instanceName,
          jenisSediaan: en_jenisSediaan(_jenisSediaan), 
          // status: en_statusCert.Requested,
          status: en_statusCert.Approved,
          timestampRequest: block.timestamp,
          timestampApprove: 0,
          cpotbNumber: "",
          bpomAddr: address(0),
          receiverName: ""
      });
 
      cpotbDataById[_cpotbId] = newCpotbData;
      allCpotbData.push(newCpotbData); 

      emit evt_cpotbRequested(_senderName, msg.sender, _instanceName, en_jenisSediaan(_jenisSediaan), _cpotbId, block.timestamp);
  } 
 
  function approveCpotb(
    string memory _cpotbId,  
    string memory _cpotbNumber, 
    string memory _receiverName
  ) public onlyBPOM {
    st_cpotbData storage cpotbDatas = cpotbDataById[_cpotbId];
    require(cpotbDatas.status == en_statusCert.Requested, "CPOTB status must be Requested!");
    
    cpotbDatas.status = en_statusCert.Approved;
    cpotbDatas.cpotbNumber = _cpotbNumber;
    cpotbDatas.timestampApprove = block.timestamp;
    cpotbDatas.bpomAddr = msg.sender;
    cpotbDatas.receiverName = _receiverName;

    for(uint i = 0; i < allCpotbData.length; i++){ 
      if (keccak256(abi.encodePacked(allCpotbData[i].cpotbId)) == keccak256(abi.encodePacked(_cpotbId))) {
        allCpotbData[i].status = en_statusCert.Approved;
        allCpotbData[i].cpotbNumber = _cpotbNumber;
        allCpotbData[i].timestampApprove = block.timestamp;
        allCpotbData[i].bpomAddr = msg.sender;
        allCpotbData[i].receiverName = _receiverName;
 
        break;
      } 
    } 

    emit evt_cpotbApproved(msg.sender, _receiverName, cpotbDatas.factoryName, _cpotbNumber, block.timestamp);
  }

  function hasApprovedCpotb(string memory _factoryName)
      public
      view
      returns (uint8[] memory)
  {
      uint256 count = 0;

      // First pass: Count how many entries match
      for (uint256 i = 0; i < allCpotbData.length; i++) {
          bool nameMatch = keccak256(abi.encodePacked(allCpotbData[i].factoryName)) == keccak256(abi.encodePacked(_factoryName));
          bool statusApproved = allCpotbData[i].status == en_statusCert.Approved;
  
          if (nameMatch && statusApproved) {
            count++;
          }
      }

      // Create a fixed-size array for the results
      uint8[] memory jenisSediaanAvailArray = new uint8[](count);

      uint256 index = 0;

      // Second pass: Populate the array
      for (uint256 i = 0; i < allCpotbData.length; i++) {
          bool nameMatch = keccak256(abi.encodePacked(allCpotbData[i].factoryName)) == keccak256(abi.encodePacked(_factoryName));
          bool statusApproved = allCpotbData[i].status == en_statusCert.Approved;

          if (nameMatch && statusApproved) {
              jenisSediaanAvailArray[index] = uint8(allCpotbData[i].jenisSediaan);
              index++;
          }
      }

      return jenisSediaanAvailArray;
  }

  function getListCpotbByFactory(string memory _instanceName) 
    public view returns (
      uint8[] memory, 
      uint8[] memory, 
      uint256[] memory, 
      string[] memory) 
  {
      st_cpotbData[] memory cpotbDataArray = new st_cpotbData[](allCpotbData.length);
      uint length = 0;

      for (uint i = 0; i < allCpotbData.length; i++) {
          if (keccak256(abi.encodePacked(allCpotbData[i].factoryName)) == keccak256(abi.encodePacked(_instanceName))) {
              cpotbDataArray[length] = allCpotbData[i];
              length++;
          }
      }

      uint8[] memory jenisSediaanArray = new uint8[](length);
      string[] memory cpotbIdArray = new string[](length);
      uint8[] memory statusArray = new uint8[](length);
      uint256[] memory latestTimestampArray = new uint256[](length);

      for (uint i = 0; i < length; i++) {
          jenisSediaanArray[i] = uint8(cpotbDataArray[i].jenisSediaan);
          statusArray[i] = uint8(cpotbDataArray[i].status);
          cpotbIdArray[i] = cpotbDataArray[i].cpotbId;
          uint latest = cpotbDataArray[i].timestampApprove > cpotbDataArray[i].timestampRequest 
              ? cpotbDataArray[i].timestampApprove 
              : cpotbDataArray[i].timestampRequest;
          latestTimestampArray[i] = latest;

      }
      return (
        jenisSediaanArray, 
        statusArray, 
        latestTimestampArray, 
        cpotbIdArray
      );
  }
  
  function getListAllCpotb() 
    public view returns (
      uint8[] memory, 
      string[] memory, 
      uint8[] memory, 
      uint256[] memory, 
      string[] memory) 
  { 
    uint length = allCpotbData.length;

    uint8[] memory jenisSediaanArray = new uint8[](length);
    string[] memory cpotbIdArray = new string[](length);
    string[] memory factoryNameArray = new string[](length);
    uint8[] memory statusArray = new uint8[](length);
    uint256[] memory latestTimestampArray = new uint256[](length);

    for (uint i = 0; i < length; i++) {  
        jenisSediaanArray[i] = uint8(allCpotbData[i].jenisSediaan);
        statusArray[i] = uint8(allCpotbData[i].status);
        factoryNameArray[i] = allCpotbData[i].factoryName; 
        cpotbIdArray[i] = allCpotbData[i].cpotbId;
        uint latest = allCpotbData[i].timestampApprove > allCpotbData[i].timestampRequest 
            ? allCpotbData[i].timestampApprove 
            : allCpotbData[i].timestampRequest;
        latestTimestampArray[i] = latest; 
    }

    return (
      jenisSediaanArray, 
      factoryNameArray, 
      statusArray, 
      latestTimestampArray, 
      cpotbIdArray
    );  
  }

  function getListCpotbById(string memory _cpotbId) public view returns(st_cpotbData memory) {
    require(bytes(cpotbDataById[_cpotbId].cpotbId).length > 0, "No data found for this ID.");
    return cpotbDataById[_cpotbId];
  }

  function requestCdob(
      string memory _instanceName,
      string memory _cdobId,
      string memory _senderName,
      en_tipePermohonan _tipePermohonan
  ) public onlyPBF {
      st_cdobData memory newCdobData = st_cdobData({
          cdobId: _cdobId, 
          senderName: _senderName,
          pbfAddr: msg.sender, 
          pbfName: _instanceName, 
          tipePermohonan: _tipePermohonan, 
          status: en_statusCert.Requested,
          timestampRequest: block.timestamp,
          timestampApprove: 0,
          cdobNumber: "",
          bpomAddr: address(0),
          receiverName: ""
      }); 

      cdobDataById[_cdobId] = newCdobData;
      allCdobData.push(newCdobData); 

      emit evt_cdobRequested(_senderName, msg.sender, _instanceName, _tipePermohonan, _cdobId, block.timestamp);
  }  

  function approveCdob(
    string memory _cdobId,  
    string memory _cdobNumber, 
    string memory _receiverName
  ) public onlyBPOM {
    st_cdobData storage cdobDatas = cdobDataById[_cdobId];
    require(cdobDatas.status == en_statusCert.Requested, "CPOTB status must be Requested!");
    
    cdobDatas.status = en_statusCert.Approved;
    cdobDatas.cdobNumber = _cdobNumber;
    cdobDatas.timestampApprove = block.timestamp;
    cdobDatas.bpomAddr = msg.sender;
    cdobDatas.receiverName = _receiverName;

    for(uint i = 0; i < allCdobData.length; i++){ 
      if (keccak256(abi.encodePacked(allCdobData[i].cdobId)) == keccak256(abi.encodePacked(_cdobId))) {
        allCdobData[i].status = en_statusCert.Approved;
        allCdobData[i].cdobNumber = _cdobNumber;
        allCdobData[i].timestampApprove = block.timestamp;
        allCdobData[i].bpomAddr = msg.sender;
        allCdobData[i].receiverName = _receiverName;
 
        break;  
      } 
    } 

    emit evt_cpotbApproved(msg.sender, _receiverName, cdobDatas.pbfName, _cdobNumber, block.timestamp);
  }

  function getListCdobByPbf(string memory _instanceName) 
    public view returns (
      uint8[] memory, 
      uint8[] memory, 
      uint256[] memory, 
      string[] memory) 
  {
      st_cdobData[] memory cdobDataArray = new st_cdobData[](allCdobData.length);
      uint length = 0; 

      for (uint i = 0; i < allCdobData.length; i++) {
          if (keccak256(abi.encodePacked(allCdobData[i].pbfName)) == keccak256(abi.encodePacked(_instanceName))) {
              cdobDataArray[length] = allCdobData[i];
              length++;
          } 
      }

      uint8[] memory tipePermohonan = new uint8[](length);
      string[] memory cdobIdArray = new string[](length);
      uint8[] memory statusArray = new uint8[](length);
      uint256[] memory latestTimestampArray = new uint256[](length);

      for (uint i = 0; i < length; i++) {
          tipePermohonan[i] = uint8(cdobDataArray[i].tipePermohonan);
          statusArray[i] = uint8(cdobDataArray[i].status);
          cdobIdArray[i] = cdobDataArray[i].cdobId;
          uint latest = cdobDataArray[i].timestampApprove > cdobDataArray[i].timestampRequest 
              ? cdobDataArray[i].timestampApprove 
              : cdobDataArray[i].timestampRequest;
          latestTimestampArray[i] = latest;

      }
      return (
        tipePermohonan, 
        statusArray, 
        latestTimestampArray, 
        cdobIdArray
      );
  }

  function getListAllCdob() 
    public view returns (
      uint8[] memory, 
      string[] memory, 
      uint8[] memory, 
      uint256[] memory, 
      string[] memory) 
  { 
    uint length = allCdobData.length;

    uint8[] memory tipePermohonanArray = new uint8[](length);
    string[] memory cdobIdArray = new string[](length);
    string[] memory pbfNameArray = new string[](length);
    uint8[] memory statusArray = new uint8[](length);
    uint256[] memory latestTimestampArray = new uint256[](length);

    for (uint i = 0; i < length; i++) {  
        tipePermohonanArray[i] = uint8(allCdobData[i].tipePermohonan);
        statusArray[i] = uint8(allCdobData[i].status);
        pbfNameArray[i] = allCdobData[i].pbfName; 
        cdobIdArray[i] = allCdobData[i].cdobId;
        uint latest = allCdobData[i].timestampApprove > allCdobData[i].timestampRequest 
            ? allCdobData[i].timestampApprove 
            : allCdobData[i].timestampRequest;
        latestTimestampArray[i] = latest;  
    }

    return (
      tipePermohonanArray, 
      pbfNameArray, 
      statusArray, 
      latestTimestampArray, 
      cdobIdArray
    );  
  }

  function getListCdobById(string memory _cdobId) public view returns(st_cdobData memory) {
    require(bytes(cdobDataById[_cdobId].cdobId).length > 0, "No data found for this ID.");

    return cdobDataById[_cdobId];
  } 

}

contracts/ObatTradisional.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "./RoleManager.sol";
import "./MainSupplyChain.sol";
 
contract ObatTradisional {

  RoleManager public roleManager;
  MainSupplyChain public mainSupplyChain; 

  constructor(address _roleManagerAddr, address _mainSupplyChainAddr) {
    roleManager = RoleManager(_roleManagerAddr);
    mainSupplyChain = MainSupplyChain(_mainSupplyChainAddr);
  }

  modifier onlyFactory() { 
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.Pabrik), "Access restricted to Pabrik role");
    _;
  } 

  modifier onlyPBF() {
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.PBF), "Access restricted to PBF role");
    _;
  }

  modifier onlyRetailer() {
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.Retailer), "Access restricted to Retailer role");
    _;
  }

  modifier onlyBPOM() {
    require(roleManager.hasRole(msg.sender, RoleManager.en_roles.BPOM), "Access restricted to BPOM role");
    _;
  }

  enum en_nieStatus { inLocalProduction, RequestedNIE, ApprovedNIE }
  enum en_orderStatus { OrderPlaced , OrderShipped , OrderDelivered  }
  enum en_obatAvailability { ready, sold }
  enum en_roles { Pabrik, PBF, BPOM, Retailer }
  enum en_tipeProduk {obatTradisional, suplemenKesehatan}
  enum en_jenisSediaan { Tablet, Kapsul, KapsulLunak, SerbukOral, CairanOral, CairanObatDalam, CairanObatLuar, FilmStrip, Pil}

  struct st_obatDetails {
    string obatId;
    string merk;
    string namaProduk;
    string[] klaim;
    string kemasan; 
    string[] komposisi;
    en_tipeProduk tipeProduk;
    en_nieStatus obatStatus;      
    uint256 nieRequestDate;       
    uint256 nieApprovalDate;        
    string nieNumber; 
  }

  struct st_obatProduction {
    en_obatAvailability statusStok;
    string batchName;
    string obatId; // untuk collect data pabrik, sm detail obat kyk nie, klaim dst
    string namaProduk;
    uint8 obatQuantity;
    string factoryInstanceNames;
    string[] obatIpfsHash;
  }

  struct st_orderObat {
    string orderId;
    string namaProduk;
    string obatIdProduk;
    uint8 orderQuantity;
    string senderInstanceName;
    address senderInstanceAddr;
    string targetInstanceName; // yg punya obatnya
    en_orderStatus statusOrder; 
    uint latestTimestamp;
    string[] orderObatIpfsHash;
  }

  st_obatDetails[] public allObatData;
  st_obatProduction[] public allProducedObat;
  st_orderObat[] public allOrderedObat;

  mapping(string => address) public bpomAddresses;
  mapping(string => string) public bpomInstanceNames;
  mapping(string => string) public bpomUserNames;
  mapping(string => address) public factoryAddresses;
  mapping(string => string) public factoryInstanceNames;
  mapping(string => string) public factoryUserNames;

  mapping (address => en_roles) public userRoles;
  mapping (string => st_obatDetails) public obatDetailsById;
  mapping (string => st_obatDetails) public obatDetailsByNameProduct;
  mapping (string => st_obatProduction) public obatProductionDetailsByBatchName;

  mapping (string => st_orderObat) public orderObatById; 

  event evt_obatCreated(string namaProduk, string factoryInstanceNames, string factoryUserNames, address factoryAddresses, string kemasan, en_tipeProduk en_tipeProduk);
  event evt_nieRequested(string obatId, uint timestampRequested, string namaProduk);
  event evt_nieApproved(string nieNumber, string namaProduk);
  event evt_obatProduced(string namaProduk, uint8 quantity, string batchNamee);
  event evt_obatOrdered(string namaProduk, uint8 quantity, string orderId, string senderInstanceName, address senderAddr, string targetInstanceName, uint latestTimestamp );

  function getJenisSediaanAvail(string memory _factoryInstanceName)
    public 
    view 
    returns(
      uint8[] memory
  ) {
     uint8[] memory approvedJenisSediaan = mainSupplyChain.hasApprovedCpotb(_factoryInstanceName); 

     return approvedJenisSediaan;
  } 

  function createObat(
    string memory _obatId,
    string memory _merk,
    string memory _namaProduk,
    string[] memory _klaim,
    string memory _kemasan,
    string[] memory _komposisi,
    address _factoryAddr,
    string memory _factoryInstanceName,
    string memory _factoryUserName,
    en_tipeProduk _tipeProduk
  ) public onlyFactory {
    st_obatDetails memory newObatDetails = st_obatDetails({
      obatId: _obatId,
      merk: _merk,
      namaProduk: _namaProduk,
      klaim: _klaim, 
      kemasan: _kemasan,
      komposisi: _komposisi,
      tipeProduk: _tipeProduk,
      // obatStatus: en_nieStatus.inLocalProduction,
      obatStatus: en_nieStatus.ApprovedNIE,
      nieRequestDate: 0,
      nieApprovalDate: 0,  
      // nieNumber: ""
      nieNumber: "TETSDFSDF"
    });
 
    obatDetailsById[_obatId] = newObatDetails;
    obatDetailsByNameProduct[_namaProduk] = newObatDetails;
    allObatData.push(newObatDetails);

    // Save factory details
    factoryAddresses[_obatId] = _factoryAddr;
    factoryInstanceNames[_obatId] = _factoryInstanceName;
    factoryUserNames[_obatId] = _factoryUserName;
      
    st_obatProduction memory newProduction = st_obatProduction({
      statusStok: en_obatAvailability.ready,
      batchName: "BN-20241125-sdfz-X45A",
      obatId: _obatId, 
      namaProduk: _namaProduk, 
      obatQuantity: 15, 
      factoryInstanceNames: _factoryInstanceName,
      obatIpfsHash: new string[](15)
    });

    newProduction.obatIpfsHash[0] = "QmZpjQfDeDRPRSrH4W413GwD5Wbb9UMG5imqpfqsPsAxm2";
    newProduction.obatIpfsHash[1] = "QmXVUENczfcBarBtQ2wiDtLmZV2Pa78n2kmGDpj9dje1Yn";
    newProduction.obatIpfsHash[2] = "Qmd6Qvb1oXad1wzZu5J6XrYdnGp9Fj3tQueVss9bwGVHST";
    newProduction.obatIpfsHash[3] = "QmVU2UxMrJeqhrnQDPJirauFsWs6J7XLDiDQKix8HVdETs";
    newProduction.obatIpfsHash[4] = "QmdmR4Pfnn5gCD5XaawvrviXmE3JsiaxRF3eNrzhY1CBU7";
    newProduction.obatIpfsHash[5] = "QmQrTrfggKT76nRZV8rBjcaToWfHCMzWqY4yWRpW3SD6Yg";
    newProduction.obatIpfsHash[6] = "QmQXHXQEPP2PnFbQ66hSg2ZMNd6SSzfFKCJHAEisYu822V";
    newProduction.obatIpfsHash[7] = "QmUECiX7qHiH8h4kr2u4h6qaiG8fSj9ZMtcBGgEHCUym1L";
    newProduction.obatIpfsHash[8] = "QmUwZrt9bLjnhMLCi4CFcaTvYgZaWUJRcZDKqs9c3mqyHy";
    newProduction.obatIpfsHash[9] = "QmNNuwZAUH6gX8hTck6oha4NjMhEc75xvyGCq2LpFDtYCG";
    newProduction.obatIpfsHash[10] = "QmabhxtbKye1eoGPMfdazWC5mTJsKAtUcFbShf3ZcmcmWN";
    newProduction.obatIpfsHash[11] = "QmeRhokhkG61Bi3xemD9gcZAHK8k6cu8yCNATEcrUgs4Ty";
    newProduction.obatIpfsHash[12] = "QmamRkPNMBXtpnhuX4Esb8RQm9NNpwC3zdAMTarPwWriSe";
    newProduction.obatIpfsHash[13] = "QmVk7tgpUscPGV2giKwy5KAJyCNPnSDS5dMKC3mSF95zNo";
    newProduction.obatIpfsHash[14] = "QmTdsJND7BdPAKJZD8HJpp3sTEY7DtgWo6roTtktJqhsr2";
    
    allProducedObat.push(newProduction);   
    obatProductionDetailsByBatchName[newProduction.batchName] = newProduction;

    emit evt_obatCreated(_namaProduk, _factoryInstanceName, _factoryUserName, _factoryAddr, _kemasan, en_tipeProduk(_tipeProduk));
  }
 
  function requestNie(string memory _obatId) public onlyFactory {
    st_obatDetails storage obatDetails = obatDetailsById[_obatId];
    require(obatDetails.obatStatus == en_nieStatus.inLocalProduction, "Obat Tradisional status must be in local production!");

    obatDetails.nieRequestDate = block.timestamp;
    obatDetails.obatStatus = en_nieStatus.RequestedNIE;

    for(uint i=0; i<allObatData.length; i++){
      if (keccak256(abi.encodePacked(allObatData[i].obatId)) == keccak256(abi.encodePacked(_obatId))) {
        allObatData[i].nieRequestDate = block.timestamp;
        allObatData[i].obatStatus = en_nieStatus.RequestedNIE;

        break;
      }
    }

    emit evt_nieRequested(_obatId, block.timestamp, obatDetails.namaProduk);
  }

  function approveNie(
    string memory _obatId,
    address _bpomAddr,
    string memory _bpomInstanceName,
    string memory _bpomUserName,
    string memory _nieNumber
  ) public onlyBPOM{
    st_obatDetails storage obatDetails = obatDetailsById[_obatId];
    require(obatDetails.obatStatus == en_nieStatus.RequestedNIE, "Obat Tradisional status must be RequestedNIE!");

    obatDetails.nieApprovalDate = block.timestamp;
    obatDetails.obatStatus = en_nieStatus.ApprovedNIE;
    obatDetails.nieNumber = _nieNumber;

    // Save BPOM details
    bpomAddresses[_obatId] = _bpomAddr;
    bpomInstanceNames[_obatId] = _bpomInstanceName;
    bpomUserNames[_obatId] = _bpomUserName;

    for(uint i=0; i<allObatData.length; i++){
      if (keccak256(abi.encodePacked(allObatData[i].obatId)) == keccak256(abi.encodePacked(_obatId))) {
        allObatData[i].nieApprovalDate = block.timestamp;
        allObatData[i].obatStatus = en_nieStatus.ApprovedNIE;
        allObatData[i].nieNumber = _nieNumber;

        break;  
      }
    } 

    emit evt_nieApproved(_nieNumber, obatDetails.namaProduk);
  }

  // menambahkan quantity agar bisa di ordder
  function addQuantityObat(
    string memory _namaProduk,
    string memory _batchName,
    string memory _obatId,
    uint8 _obatQuantity,
    string  memory _factoryInstanceName,
    string[] memory _obatIpfsHash
  ) public onlyFactory {

    require (_obatQuantity == _obatIpfsHash.length, "Quantity does not match the number of IDs");

      if (keccak256(abi.encodePacked(obatProductionDetailsByBatchName[_batchName].namaProduk)) == keccak256(abi.encodePacked(_namaProduk))) {
          obatProductionDetailsByBatchName[_batchName].obatQuantity = _obatQuantity;
          obatProductionDetailsByBatchName[_batchName].obatIpfsHash = _obatIpfsHash;

          for(uint i=0; i<allProducedObat.length; i++){
            if (keccak256(abi.encodePacked(allProducedObat[i].obatId)) == keccak256(abi.encodePacked(_obatId))) {
              allProducedObat[i].obatQuantity = _obatQuantity;
              allProducedObat[i].obatIpfsHash = _obatIpfsHash; 
              break; 
          }
    } 
          
      } else {
          st_obatProduction memory newProduction = st_obatProduction({
            statusStok: en_obatAvailability.ready, 
            batchName: _batchName,
            obatId: _obatId,
            namaProduk: _namaProduk,
            obatQuantity: _obatQuantity,
            factoryInstanceNames: _factoryInstanceName,
            obatIpfsHash: _obatIpfsHash
          });
      
          obatProductionDetailsByBatchName[_batchName] = newProduction;  
          allProducedObat.push(newProduction); 
      }


    emit evt_obatProduced(_namaProduk, _obatQuantity, _batchName);
     
  } 

